// SPDX-License-Identifier: MIT

pragma solidity ^0.8.12;

import { ERC1155 } from '@solidstate/contracts/token/ERC1155/ERC1155.sol';
import { IERC1155 } from '@solidstate/contracts/token/ERC1155/IERC1155.sol';
import { ERC165Storage } from '@solidstate/contracts/introspection/ERC165Storage.sol';
import { IERC20 } from '@solidstate/contracts/token/ERC20/IERC20.sol';
import { WrapperStorage } from '../libraries/WrapperStorage.sol';

contract MySet is ERC1155 {
    using ERC165Storage for ERC165Storage.Layout;

    constructor() {
        ERC165Storage.layout().setSupportedInterface(
            type(IERC1155).interfaceId,
            true
        );
    }

    function initERC1155() public {
        WrapperStorage.Layout storage l = WrapperStorage.layout();
        l.addressToID[address(0x1)] = 0x1; // ID fo tokens representing Ether
        l.IDtoAddress[0x1] = address(0x1); // Address for tokens representing Ether is 0x00...01
        l.nTokens = 1;
    }

    function getETHID() external view returns (uint256) {
        WrapperStorage.Layout storage l = WrapperStorage.layout();
        return l.addressToID[address(0x1)];
    }

    function getETHAddress() external view returns (address) {
        WrapperStorage.Layout storage l = WrapperStorage.layout();
        return l.IDtoAddress[0x1];
    }

    function __mint(
        address account,
        uint256 id,
        uint256 amount
    ) external {
        _mint(account, id, amount, '');
    }

    function __burn(
        address account,
        uint256 id,
        uint256 amount
    ) external {
        _burn(account, id, amount);
    }
}

